    NWR to improve habitat for migrating waterfowl.  The plan provides an introduction
    to the project, a list of activities during the 1981 fiscal year, and plans for
    the 1982 fiscal year.  Management activities will be primarily directed towards
    water control and levee repair. A wade-and-shoot waterfowl hunting program will
